INSERT INTO habilidade (nome,descricao) VALUES ('Adaptability','Aumenta o poder de movimentos do mesmo tipo que o Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Aerilate','Movimentos do tipo Normal se tornam movimentos do tipo Voador e o poder destes ataques é também aumentado um pouco.');
INSERT INTO habilidade (nome,descricao) VALUES ('Aftermath','Fere o atacante se ele entrar em contato com o Pokémon em um golpe final, que o tiraria da batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Air Lock','Elimina os efeitos de condições climáticas.');
INSERT INTO habilidade (nome,descricao) VALUES ('Analytic','Aumenta o poder dos movimentos se o Pokémon se mover por último.');
INSERT INTO habilidade (nome,descricao) VALUES ('Anger Point','O Pokémon fica bravo quando acerta um golpe crítico, maximizando seu stat de Ataque');
INSERT INTO habilidade (nome,descricao) VALUES ('Anger Shell','Quando o HP do portador desta habilidade cai para metade ou menos, o Pokémon fica com raiva. Isso diminui sua Defesa e Defesa Especial, mas aumenta seu Ataque, Ataque Especial e Velocidade.');
INSERT INTO habilidade (nome,descricao) VALUES ('Anticipation','O Pokémon consegue sentir um movimento poderoso que o Pokémon oponente possua, revelando-o para o seu treinador.');
INSERT INTO habilidade (nome,descricao) VALUES ('Arena Trap','Impede que os Pokémon oponentes fujam da batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Armor Tail','Torna o Pokémon oponente incapaz de utilizar movimentos de prioridade contra o Pokémon ou seus aliados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Aroma Veil','Protege a si mesmo e aos seus aliados de ataques que limitem sua escolha de movimentos.');
INSERT INTO habilidade (nome,descricao) VALUES ('As One','Esta habilidade combina o efeito das habilidades originais de dois Pokémon fundidos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Aura Break','Os efeitos das habilidades de "Aura"');
INSERT INTO habilidade (nome,descricao) VALUES ('Bad Dreams','Reduz o HP de Pokémon oponentes que estejam sendo afetados pela condição de status de sono.');
INSERT INTO habilidade (nome,descricao) VALUES ('Ball Fetch','Se o Pokémon não estiver segurando nenhum item, ele irá recuperar a primeira Pokébola cujo lançamento não foi bem sucedido contra um Pokémon selvagem, naquela batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Battery','Aumenta o poder de movimentos Especiais de aliados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Battle Armor','A armadura do Pokémon o protege contra Golpes Críticos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Battle Bond','Ao derrotar um Pokémon adversário, o vínculo entre treinador e Greninja aumenta, possibilitando que ele se torne Ash-Greninja. Com isso, o movimento Water Shuriken se torna mais poderoso.');
INSERT INTO habilidade (nome,descricao) VALUES ('Beads of Ruin','O poder do colar de contas ruinoso do Pokémon reduz a base stat de Defesa Especial de todos os Pokémon em campo, exceto ele mesmo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Beast Boost','O Pokémon aumenta o seu stat mais proficiente a cada vez que derrotar um Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Berserk','Aumenta o Ataque Especial do Pokémon quando ele toma um golpe que faz com que sobre apenas metade ou menos do seu HP.');
INSERT INTO habilidade (nome,descricao) VALUES ('Big Pecks','Protege o Pokémon de efeitos que diminuam sua Defesa');
INSERT INTO habilidade (nome,descricao) VALUES ('Blaze','Aumenta o Poder de movimentos do tipo Fogo quando o HP do Pokémon estiver baixo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Bulletproof','Protege o Pokémon de alguns com terminologia "ball" e "bomb". Exemplo');
INSERT INTO habilidade (nome,descricao) VALUES ('Cheek Pouch','Restaura 33% do HP máximo do Pokémon quando ele consumir uma Berry.');
INSERT INTO habilidade (nome,descricao) VALUES ('Chilling Neigh','Quando o Pokémon nocauteia um alvo, ele emite um relincho arrepiante, que aumenta seu stat de Ataque.');
INSERT INTO habilidade (nome,descricao) VALUES ('Chlorophyll','Aumenta o stat de Velocidade do Pokémon quando o sol estiver forte');
INSERT INTO habilidade (nome,descricao) VALUES ('Clear Body','Impede que movimentos e habilidades de outros Pokémon reduzam os stats do portador desta habilidade.');
INSERT INTO habilidade (nome,descricao) VALUES ('Cloud Nine','Elimina os efeitos de condições climáticas.');
INSERT INTO habilidade (nome,descricao) VALUES ('Color Change','O tipo do Pokémon muda para o tipo do movimento com o qual ele foi atacado por último.');
INSERT INTO habilidade (nome,descricao) VALUES ('Comatose','O Pokémon está sempre dormindo e nunca acorda, mas conseguirá atacar mesmo sem acordar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Commander','Quando o Pokémon entra em uma batalha, ele entra na boca de um Dondozo aliado se estiver em campo. O Pokémon então emite comandos de lá. Enquanto Tatsugiri estiver dentro da boca de Dondozo, Dondozo ficará incapaz de retornar para a pokébola, mas terá seu Ataque, Defesa, Ataque Especial, Defesa Especial e Velocidade aumentados em dois estágios cada. O treinador não será capaz de selecionar movimentos para Tatsugiri, e qualquer movimento do oponente falhará se Tatsugiri for o alvo. Quando Dondozo desmaia , Tatsugiri retorna à sua posição normal na batalha. Commander não é ativada em Tera Raid Battles. Role Play, Skill Swap e Entrainment falham se um dos Pokémon tiver Commander. Commander não pode ser copiado por Trace, Power of Alchemy ou Receiver. Commander não pode ser substituído por Mummy ou Lingering Aroma ou trocado por Wandering Spirit.');
INSERT INTO habilidade (nome,descricao) VALUES ('Competitive','Aumenta bastante o Ataque Especial do Pokémon quando um stat seu é reduzido.');
INSERT INTO habilidade (nome,descricao) VALUES ('Compound Eyes','Aumenta o seu stat de accuracy');
INSERT INTO habilidade (nome,descricao) VALUES ('Contrary','Faz com que alterações de stats tenham o efeito oposto.');
INSERT INTO habilidade (nome,descricao) VALUES ('Corrosion','O Pokémon consegue envenenar um alvo mesmo que ele pertença aos tipo Aço ou Venenoso.');
INSERT INTO habilidade (nome,descricao) VALUES ('Costar','Quando o Pokémon entra em uma batalha, ele copia as mudanças de stats de um aliado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Cotton Down','Quando o Pokémon é atacado, ele espalha algodões ao seu redor, diminuindo o stat de Velocidade de todos os Pokémon exceto ele próprio.');
INSERT INTO habilidade (nome,descricao) VALUES ('Cud Chew','Quando um Pokémon com esta habilidade come uma Berry, ele a comerá mais uma vez no final do próximo turno.');
INSERT INTO habilidade (nome,descricao) VALUES ('Curious Medicine','Quando o Pokémon entra em uma batalha, ele espalha o remédio de sua concha, o que remove todas as mudanças de estatísticas dos aliados, repondo-as em 0');
INSERT INTO habilidade (nome,descricao) VALUES ('Cursed Body','Pode desabilitar um movimento utilizado pelo oponente contra o portador.');
INSERT INTO habilidade (nome,descricao) VALUES ('Cute Charm','Contato físico com o Pokémon portador pode causar estado de atração no atacante.');
INSERT INTO habilidade (nome,descricao) VALUES ('Damp','Impede o uso de movimentos explosivos, tal como Self-Destruct, ao umedecer o ambiente ao redor.');
INSERT INTO habilidade (nome,descricao) VALUES ('Dancer','Quando um Pokémon adversário utiliza um movimento com a terminologia "Dance", o portador desta habilidade poderá utilizar um movimento também de dança imediatamente na sequência, independentemente de sua Velocidade.');
INSERT INTO habilidade (nome,descricao) VALUES ('Dark Aura','Amplifica o poder de movimentos do tipo Sombrio.');
INSERT INTO habilidade (nome,descricao) VALUES ('Dauntless Shield','Aumenta o stat de Defesa');
INSERT INTO habilidade (nome,descricao) VALUES ('Dazzling','Surpreende o Pokémon adversário, fazendo com que ele não possa utilizar movimentos de Prioridade.');
INSERT INTO habilidade (nome,descricao) VALUES ('Defeatist','Corta o Ataque físico E especial do portador pela metade quando seu HP atinge a metade ou menos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Defiant','Aumenta bastante o Ataque Físico do Pokémon quando um stat seu é reduzido.');
INSERT INTO habilidade (nome,descricao) VALUES ('Delta Stream','O Pokémon muda o clima para eliminar todas as fraquezas do tipo Voador.');
INSERT INTO habilidade (nome,descricao) VALUES ('Desolate Land','O Pokémon muda o clima para anular movimentos do tipo Água.');
INSERT INTO habilidade (nome,descricao) VALUES ('Disguise','Uma vez por batalha, a capa que esconde o Pokémon pode protegê-lo completamente de um ataque.');
INSERT INTO habilidade (nome,descricao) VALUES ('Download','Compara os stats de Defesa e Defesa Especial de um oponente antes de aumentar o próprio Ataque ou Ataque Especial do portador, escolhendo qual das duas opções será a mais efetiva.');
INSERT INTO habilidade (nome,descricao) VALUES ('Dragons Maw','Aumenta o poder dos movimentos do tipo dragão em 50%.');
INSERT INTO habilidade (nome,descricao) VALUES ('Drizzle','Assim que o Pokémon entra em batalha, começa a chover');
INSERT INTO habilidade (nome,descricao) VALUES ('Drought','Assim que o Pokémon entra em batalha, o sol fica forte');
INSERT INTO habilidade (nome,descricao) VALUES ('Dry Skin','Restaura o HP do usuário durante a chuva ou quando é atingido por movimentos do tipo água, porém REDUZ o HP do usuário e aumenta o dano recebido por ataques do tipo fogo quando o sol estiver forte.');
INSERT INTO habilidade (nome,descricao) VALUES ('Early Bird','O Pokémon se acorda, saindo da condição de status de sono, 2 vezes mais rápido.');
INSERT INTO habilidade (nome,descricao) VALUES ('Earth Eater','Se atingido por um movimento do tipo Terra, o Pokémon portador desta habilidade tem seu HP restaurado ao invés de sofrer dano.');
INSERT INTO habilidade (nome,descricao) VALUES ('Effect Spore','Contato físico com o Pokémon portador pode causar envenenamento, paralisia ou sono em seu atacante.');
INSERT INTO habilidade (nome,descricao) VALUES ('Electric Surge','Ativa o efeito de Electric Terrain assim que o Pokémon entra em batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Electromorphosis','O portador desta habilidade fica carregado quando atingido por um ataque, aumentando o poder do próximo movimento do tipo Elétrico que ele usar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Emergency Exit','O Pokémon, pressentindo o perigo, volta para a pokébola assim que seu HP atinge a metade ou menos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Fairy Aura','Amplifica o poder de movimentos do tipo Fada.');
INSERT INTO habilidade (nome,descricao) VALUES ('Filter','Reduz o poder de movimentos superefetivos tomados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Flame Body','Contato físico com o Pokémon portador pode causar queimaduras e ter o Pokémon na equipe faz com que ovos choquem mais rápido.');
INSERT INTO habilidade (nome,descricao) VALUES ('Flare Boost','Aumenta o poder de movimentos especiais quando o Pokémon estiver sofrendo de queimaduras.');
INSERT INTO habilidade (nome,descricao) VALUES ('Flash Fire','Aumenta o Poder de Movimentos do tipo Fogo quando o Pokémon é atingido por um.');
INSERT INTO habilidade (nome,descricao) VALUES ('Flower Gift','Aumenta o Ataque e a Defesa Especial do Pokémon e dos Aliados quando o sol estiver forte.');
INSERT INTO habilidade (nome,descricao) VALUES ('Flower Veil','Aliados do tipo Planta são protegidos de Condições de Status e de redução de quaisquer stats.');
INSERT INTO habilidade (nome,descricao) VALUES ('Fluffy','Corta pela metade o dano de movimentos que inflijam contato físico com o portador, mas duplica o dano recebido por movimentos do tipo Fogo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Forecast','O Pokémon troca de forma de acordo com a condição climática.');
INSERT INTO habilidade (nome,descricao) VALUES ('Forewarn','Quando entra em batalha, o Pokémon pode revelar para o seu treinador, um dos movimentos que o oponente possui, em antecipação.');
INSERT INTO habilidade (nome,descricao) VALUES ('Friend Guard','Reduz danos causados a aliados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Frisk','Quando entra em batalha, o Pokémon pode revelar para o seu treinador, o item que o oponente segura.');
INSERT INTO habilidade (nome,descricao) VALUES ('Full Metal Body','Impede que movimentos e habilidades de outros Pokémon reduzam os stats do Pokémon portador.');
INSERT INTO habilidade (nome,descricao) VALUES ('Fur Coat','Corta pela metade o dano de movimentos que inflijam contato físico com o portador.');
INSERT INTO habilidade (nome,descricao) VALUES ('Gale Wings','Dá Prioridade a movimentos do tipo Voador quando o HP do usuário estiver cheio.');
INSERT INTO habilidade (nome,descricao) VALUES ('Galvanize','Movimentos do tipo Normal se tornam movimentos do tipo Elétrico e o poder destes ataques é também aumentado um pouco.');
INSERT INTO habilidade (nome,descricao) VALUES ('Gluttony','Faz com que o Pokémon imediatamente coma uma Berry quando o seu HP atingir metade ou menos, o que geralmente é mais cedo que o usual.');
INSERT INTO habilidade (nome,descricao) VALUES ('Good ad Gold','Um corpo de ouro puro e sólido dá ao Pokémon total imunidade aos movimentos de status de outros Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Gooey','Contato físico com o Pokémon reduz o stat de Velocidade do atacante.');
INSERT INTO habilidade (nome,descricao) VALUES ('Gorilla Tactics','Aumenta o stat de Ataque do Pokémon mas o limita a poder utilizar apenas o primeiro movimento selecionado durante toda a batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Grass Pelt','Aumenta o stat de Defesa');
INSERT INTO habilidade (nome,descricao) VALUES ('Grassy Surge','Ativa o efeito de Grassy Terrain assim que o Pokémon entra em batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Grim Neigh','Quando o Pokémon nocauteia um alvo, ele emite um relincho assustador, que aumenta seu stat de Sp. Atk.');
INSERT INTO habilidade (nome,descricao) VALUES ('Guard Dog','Aumenta o Ataque');
INSERT INTO habilidade (nome,descricao) VALUES ('Gulp Missile','Quando o Pokémon utiliza Surf ou Dive, ele voltará com uma presa. Quando o portador receber dano, ele então irá cuspir a presa como uma forma de atacar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Guts','Ter uma Condição de Status aumenta o Ataque Físico do Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Hadron Engine','Ativa o efeito de Electric Terrain quando o Pokémon portador desta habilidade entra em batalha. O motor futurístico dentro do Pokémon também aumenta seu stat de Ataque Especial sob o efeito de Electric Terrain.');
INSERT INTO habilidade (nome,descricao) VALUES ('Harvest','Pode criar uma nova Berry após o Pokémon utilizar uma. A Partir da 8ª Geração, se o Pokémon com esta habilidade estiver na 1ª posição da equipe');
INSERT INTO habilidade (nome,descricao) VALUES ('Healer','Às vezes pode curar a condição de status de um aliado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Heatproof','Corta pela metade o dano de ataques do tipo Fogo que atingirem o Portador.');
INSERT INTO habilidade (nome,descricao) VALUES ('Heavy Metal','Duplica o peso do Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Honey Gather','O Pokémon pode encontrar Mel após a batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Huge Power','Duplica o stat de Ataque Físico do Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Hunger Switch','O Pokémon troca de forma ao final de cada turno.');
INSERT INTO habilidade (nome,descricao) VALUES ('Hustle','Aumenta o stat de Ataque Físico do Pokémon, mas diminui sua pontaria.');
INSERT INTO habilidade (nome,descricao) VALUES ('Hydration','Cura condições de status do Pokémon se estiver chovendo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Hyper Cutter','Impede que outros Pokémon diminuam o stat de Ataque Físico do portador.');
INSERT INTO habilidade (nome,descricao) VALUES ('Ice Body','O Pokémon gradualmente vai recuperando seu HP durante uma chuva de granizo');
INSERT INTO habilidade (nome,descricao) VALUES ('Ice Face','A cabeça de gelo do Pokémon pode receber um ataque físico como um Substitute, mas o ataque também irá mudar a aparência do Pokémon. O gelo poderá ser restaurado quando estiver chovendo granizo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Ice Scales','O Pokémon é protegido por escamas de gelo, que cortam pela metade o dano tomado por Movimentos Especiais.');
INSERT INTO habilidade (nome,descricao) VALUES ('Illuminate','Aumenta as chances de encontrar Pokémon Selvagens ao iluminar ao seu redor.');
INSERT INTO habilidade (nome,descricao) VALUES ('Illusion','O Pokémon entra em batalha disfarçado do último Pokémon na equipe do jogador.');
INSERT INTO habilidade (nome,descricao) VALUES ('Immunity','Torna o Pokémon imune à envenenamento');
INSERT INTO habilidade (nome,descricao) VALUES ('Imposter','O Pokémon automaticamente se transforma no Pokémon contra o qual ele está batalhando, aprendendo todos os seus movimentos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Infiltrator','Penetra a barreira ou o Substitute do Pokémon adversário para atacar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Innards Out','Causa danos ao atacante que infligir um golpe final derrotando o Pokémon Portador, igual à quantidade de seu último HP.');
INSERT INTO habilidade (nome,descricao) VALUES ('Inner Focus','O Pokémon não pode recuar');
INSERT INTO habilidade (nome,descricao) VALUES ('Insomnia','O Pokémon não pode pegar no sono');
INSERT INTO habilidade (nome,descricao) VALUES ('Intimidate','O Pokémon, ao entrar em batalha, intimida o oponente, diminuindo seu stat de Ataque Físico.');
INSERT INTO habilidade (nome,descricao) VALUES ('Intrepid Sword','Aumenta o stat de Ataque do Pokémon sempre que ele deixa a pokébola e entra em uma partida.');
INSERT INTO habilidade (nome,descricao) VALUES ('Iron Barbs','Inflige dano quando o adversário atacar o Pokémon com um movimento de contato físico.');
INSERT INTO habilidade (nome,descricao) VALUES ('Iron Fist','Aumenta o poder de movimentos com a terminologia "Punch".');
INSERT INTO habilidade (nome,descricao) VALUES ('Justified','Ser acertado por um movimento do tipo Sombrio faz com que o stat de Ataque Físico do Pokémon seja aumentado, por justiça.');
INSERT INTO habilidade (nome,descricao) VALUES ('Keen Eye','Impede que outros Pokémon diminuam a pontaria');
INSERT INTO habilidade (nome,descricao) VALUES ('Klutz','O Pokémon Portador não pode segurar nenhum item.');
INSERT INTO habilidade (nome,descricao) VALUES ('Leaf Guard','Impede que o Pokémon sofra de condições de status quando o sol estiver forte.');
INSERT INTO habilidade (nome,descricao) VALUES ('Levitate','Ao flutuar no ar, o Pokémon recebe imunidade total a todos os movimentos do tipo Terra.');
INSERT INTO habilidade (nome,descricao) VALUES ('Libero','Muda o tipo Pokémon para o tipo do movimento que ele está prestes a usar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Light Metal','Diminui o Peso do Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Lightning Rod','O Pokémon atrai para si todos os ataques dos tipo elétrico e ao invés de ser atingido por eles, o seu Ataque Especial é aumentado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Limber','O Pokémon não pode ser paralisado');
INSERT INTO habilidade (nome,descricao) VALUES ('Lingering Aroma','Contato físico direto com o Pokémon portador desta habilidade altera a habilidade do atacante para Lingering Aroma também.');
INSERT INTO habilidade (nome,descricao) VALUES ('Liquid Ooze','Se o Pokémon adversário usar um movimento de dreno contra o portador desta habilidade, ele PERDERÁ HP ao invés de ganhar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Liquid Voice','Todos os movimentos baseados em "Som" se tornam do tipo Água.');
INSERT INTO habilidade (nome,descricao) VALUES ('Long Reach','O Pokémon usa movimentos sem fazer contato físico com o alvo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Magic Bounce','Reflete movimentos de status ao invés de ser atingido por eles.');
INSERT INTO habilidade (nome,descricao) VALUES ('Magic Guard','O Pokémon só recebe dano proveniente de ataques. Isto é, esta habilidade impede que o Pokémon receba dano indireto, como através de condições de status');
INSERT INTO habilidade (nome,descricao) VALUES ('Magician','Se o Pokémon acertar um movimento, ele irá roubar o item que o alvo segura.');
INSERT INTO habilidade (nome,descricao) VALUES ('Magma Armor','O Pokémon é coberto com magma quente, impedindo-o de ser congelado');
INSERT INTO habilidade (nome,descricao) VALUES ('Magnet Pull','Impede que Pokémon do tipo Aço escapem usando sua força magnética.');
INSERT INTO habilidade (nome,descricao) VALUES ('Marvel Scale','As escamas do Pokémon aumentam o stat de Defesa do mesmo se ele tiver uma condição de status.');
INSERT INTO habilidade (nome,descricao) VALUES ('Mega Launcher','Amplifica o poder de movimentos com as terminologias "Aura" e "Pulse".');
INSERT INTO habilidade (nome,descricao) VALUES ('Merciless','Os ataques do Pokémon se tornam Golpes Críticos se o alvo estiver envenenado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Mimicry','Muda o tipo do Pokémon de acordo com o Terrain que estiver em efeito.');
INSERT INTO habilidade (nome,descricao) VALUES ('Minus','Aumenta o Ataque Especial do Pokémon se um aliado com a habilidade Plus ou Minus também estiver em batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Mirror Armor','Rebate apenas os efeitos redutores de stats que o Pokémon recebe.');
INSERT INTO habilidade (nome,descricao) VALUES ('Misty Surge','Ativa o efeito de Misty Terrain assim que o Pokémon entra em batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Mold Breaker','Movimentos podem ser usados no alvo independentemente de suas habilidades.');
INSERT INTO habilidade (nome,descricao) VALUES ('Moody','Aumenta bastante um stat e diminui outro a cada turno.');
INSERT INTO habilidade (nome,descricao) VALUES ('Motor Drive','Aumenta o seu stat de Velocidade se acertado por um movimento do tipo elétrico ao invés de levar dano.');
INSERT INTO habilidade (nome,descricao) VALUES ('Moxie','Aumenta o stat de Ataque Físico do Portador após ele nocautear outro Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Multiscale','Reduz a quantidade de dano que o Pokémon toma quando seu HP estiver cheio.');
INSERT INTO habilidade (nome,descricao) VALUES ('Multitype','Muda o tipo do Pokémon para combinar com a Plate ou o Z-Crystal que ele estiver segurando.');
INSERT INTO habilidade (nome,descricao) VALUES ('Mummy','Contato com o Pokémon Portador irá fazer com que a habilidade do atacante também se torne Mummy e assim, ela vai sendo passada adiante, sucessivamente.');
INSERT INTO habilidade (nome,descricao) VALUES ('Mycelium Might','O Pokémon sempre agirá mais devagar quando utilizando movimentos de status, no entanto, estes movimentos jamais serão impedidos pela habilidade do alvo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Natural Cure','Todas as condições de status são curadas quando o Pokémon é substituído/volta para a pokébola.');
INSERT INTO habilidade (nome,descricao) VALUES ('Neuroforce','Aumenta o poder de movimentos que são superefetivos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Neutralizing Gas','Os Efeitos das habilidades de todos os outros Pokémon serão anulados e/ou as habilidades não serão ativadas enquanto o Pokémon Portador estiver em campo.');
INSERT INTO habilidade (nome,descricao) VALUES ('No Guard','Todos os movimentos usados por este Pokémon nunca falham, porém, todos os movimentos utilizados CONTRA também nunca falharão, mesmo se o usuário estiver em um turno semi-invulnerável de movimentos como Fly ou Dig.');
INSERT INTO habilidade (nome,descricao) VALUES ('Normalize','Todos os movimentos do Pokémon se tornam do tipo Normal e seu poder é amplificado um pouco.');
INSERT INTO habilidade (nome,descricao) VALUES ('Oblivious','O Pokémon não pode entrar em estado de atração e nem de ser atingido por Taunt, porque é desatento.');
INSERT INTO habilidade (nome,descricao) VALUES ('Opportunist','Se a estatística de um oponente for aumentada, o Pokémon apodera-se da oportunidade de aumentar a mesma estatística para si mesmo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Orichalcum Pulse','A luz do sol é intensificada quando o Pokémon portador desta habilidade entra em batalha. O pulso antigo vibrando através do Pokémon também aumenta seu stat de Ataque');
INSERT INTO habilidade (nome,descricao) VALUES ('Overcoat','Protege o Pokémon de coisas como "areia", "granizo" e "pó".');
INSERT INTO habilidade (nome,descricao) VALUES ('Overgrow','Aumenta o Poder de movimentos do tipo Planta quando o HP do Pokémon estiver baixo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Own Tempo','O Pokémon não pode ficar confuso');
INSERT INTO habilidade (nome,descricao) VALUES ('Parental Bond','O Pai e o Filho atacam juntos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Pastel Veil','Protege o Pokémon e seus aliados de serem envenenados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Perish Body','Quando atingido por um movimento que faz contato direto, o Pokémon e o atacante irão ficar fora de combate após a passagem de 3 turnos, a menos que eles sejam substituídos/voltem para a pokébola.');
INSERT INTO habilidade (nome,descricao) VALUES ('Pickpocket','Rouba o item de um atacante que atingir o Pokémon Portador com um ataque físico.');
INSERT INTO habilidade (nome,descricao) VALUES ('Pickup','O Pokémon pode pegar o item que um Pokémon oponente usou durante uma batalha. Também pode pegar itens fora da batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Pixilate','Movimentos do tipo Normal se tornam movimentos do tipo Fada e o poder destes ataques é também aumentado um pouco.');
INSERT INTO habilidade (nome,descricao) VALUES ('Plus','Aumenta o Ataque Especial do Pokémon se um aliado com a habilidade Plus ou Minus também estiver em batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Poison Heal','Restaura HP se o Pokémon for envenenado em vez de perder HP.');
INSERT INTO habilidade (nome,descricao) VALUES ('Poison Point','Pode envenenar o atacante se o Pokémon Portador for atingido por um golpe de contato físico.');
INSERT INTO habilidade (nome,descricao) VALUES ('Poison Touch','Pode envenenar o alvo quando o Pokémon Portador acertar um ataque que faça contato físico.');
INSERT INTO habilidade (nome,descricao) VALUES ('Power Construct','Outras células se reúnem para ajudar quando seu HP atinge a metade ou menos. Então o Pokémon muda sua forma para sua Complete Forme.');
INSERT INTO habilidade (nome,descricao) VALUES ('Power of Alchemy','O Pokémon copia a habilidade de um aliado derrotado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Power Spot','Apenas por estar ao lado do Pokémon Portador, o poder de seus movimentos é aumentado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Prankster','Dá prioridade para um movimento de status.');
INSERT INTO habilidade (nome,descricao) VALUES ('Pressure','Os movimentos utilizados pelo oponente custarão o dobro de PP por uso.');
INSERT INTO habilidade (nome,descricao) VALUES ('Primordial Sea','O Pokémon muda o clima para anular movimentos do tipo Fogo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Prism Armor','Reduz o Poder de Movimentos Superefetivos tomados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Propeller Tail','Ignora os efeitos de redirecionamentos de ataques provenientes de habilidades');
INSERT INTO habilidade (nome,descricao) VALUES ('Protean','Muda o tipo Pokémon para o tipo do movimento que ele está prestes a usar, a qualquer momento durante a batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Protosynthesis','Aumenta o stat mais proficiente do Pokémon quando a luz do sol estiver forte ou se o Pokémon estiver segurando Booster Energy.');
INSERT INTO habilidade (nome,descricao) VALUES ('Psychic Surge','Ativa o efeito de Psychic Terrain assim que o Pokémon entra em batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Punk Rock','Aumenta o poder de movimentos baseados em Som. O Pokémon também corta pela metade o dano tomado por movimentos deste tipo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Pure Power','O stat de Ataque Físico do Pokémon é duplicado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Purifying Salt','O sal puro do Pokémon o protege contra condições de status e corta pela Metade o dano recebido de ataques do tipo Fantasma.');
INSERT INTO habilidade (nome,descricao) VALUES ('Quark Drive','Aumenta o stat mais proficiente do Pokémon quando Electric Terrain estiver sob efeito ou se o Pokémon estiver segurando Booster Energy.');
INSERT INTO habilidade (nome,descricao) VALUES ('Queenly Majesty','Os adversários não poderão utilizar movimentos de Prioridade.');
INSERT INTO habilidade (nome,descricao) VALUES ('Quick Draw','Permite que o Pokémon se mova primeiro ocasionalmente. Se um Pokémon com esta Habilidade seleciona um movimento que cause danos, ele tem 30% de chance de ser o primeiro em sua chave de prioridade.');
INSERT INTO habilidade (nome,descricao) VALUES ('Quick Feet','Aumenta o stat de Speed do Pokémon se ele tiver uma condição de status.');
INSERT INTO habilidade (nome,descricao) VALUES ('Rain Dish','O Pokémon gradualmente recupera seu HP durante a chuva');
INSERT INTO habilidade (nome,descricao) VALUES ('Rattled','Movimentos do tipo Sombrio, Fantasma ou Inseto assustam o Portador, que tem seu status de Velocidade ampliado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Receiver','O Pokémon copia a habilidade de um aliado derrotado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Reckless','Aumenta o Poder de Movimentos que causam dano de recoil');
INSERT INTO habilidade (nome,descricao) VALUES ('Refrigerate','Movimentos do tipo Normal se tornam movimentos do tipo Gelo e o poder destes ataques é também aumentado um pouco.');
INSERT INTO habilidade (nome,descricao) VALUES ('Regenerator','Restaura um pouco do HP quando o Pokémon é retirado da batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Ripen','Duplica o efeito de Berries.');
INSERT INTO habilidade (nome,descricao) VALUES ('Rivalry','Torna-se competitivo e causa mais dano a Pokémon do mesmo sexo, mas causa menos dano a Pokémon do gênero oposto.');
INSERT INTO habilidade (nome,descricao) VALUES ('RKS System','Muda o tipo do Pokémon para combinar com a "Memory" que ele estiver segurando.');
INSERT INTO habilidade (nome,descricao) VALUES ('Rock Head','Protege o Pokémon de danos de recoil');
INSERT INTO habilidade (nome,descricao) VALUES ('Rocky Payload','Aumenta o poder de movimentos do tipo Pedra.');
INSERT INTO habilidade (nome,descricao) VALUES ('Rough Skin','Inflige dano quando o adversário atacar o Pokémon com um movimento de contato físico.');
INSERT INTO habilidade (nome,descricao) VALUES ('Run Away','Possibilita que o treinador sempre possa escapar de batalhas contra Pokémon Selvagens.');
INSERT INTO habilidade (nome,descricao) VALUES ('Sand Force','Aumenta o poder dos movimentos do tipo Pedra, Terra e Aço durante uma tempestade de areia');
INSERT INTO habilidade (nome,descricao) VALUES ('Sand Rush','Aumenta o stat de Velocidade do Pokémon durante uma tempestade de areia. Um Pokémon com Sand Rush não tomará dano de uma tempestade de areia, se de outra maneira,  ele tomaria.');
INSERT INTO habilidade (nome,descricao) VALUES ('Sand Spit','O Pokémon cria uma tempestade de areia');
INSERT INTO habilidade (nome,descricao) VALUES ('Sand Stream','O Pokémon invoca uma tempestade de areia assim que entra em batalha.');
INSERT INTO habilidade (nome,descricao) VALUES ('Sand Veil','Aumenta o stat de Evasão do Pokémon durante uma tempestade de areia.');
INSERT INTO habilidade (nome,descricao) VALUES ('Sap Sipper','Aumenta o stat de Ataque do Pokémon se ele for atingido por um movimento do tipo Planta ao invés de receber dano.');
INSERT INTO habilidade (nome,descricao) VALUES ('Schooling','Quando tem muito HP, o Pokémon forma um cardume poderoso. O efeito desta habilidade acaba e a forma do Pokémon reverte ao normal quando seu HP está baixo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Scrappy','O Pokémon pode acertar Pokémon do tipo Fantasma utilizando golpes do tipo Normal e Lutador, ao qual normalmente o tipo Fantasma normalmente seria imune.');
INSERT INTO habilidade (nome,descricao) VALUES ('Screen Cleaner','Quando o Pokémon entra em uma batalha, os efeitos de Light Screen, Reflect e Aurora Veil são anulados tanto para os oponentes quanto para os aliados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Seed Sower','Ativa o efeito de Grassy Terrain quando o Pokémon é atingido por um ataque.');
INSERT INTO habilidade (nome,descricao) VALUES ('Serene Grace','Aumenta a probabilidade de ocorrência de efeitos adicionais ao atacar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Shadow Shield','Reduz a quantidade de dano que o Pokémon recebe enquanto seu HP está cheio.');
INSERT INTO habilidade (nome,descricao) VALUES ('Shadow Tag','Este Pokémon pisa na sombra do Pokémon oponente para impedir que ele escape.');
INSERT INTO habilidade (nome,descricao) VALUES ('Sharpness','Aumenta o poder de movimentos de "corte", a saber');
INSERT INTO habilidade (nome,descricao) VALUES ('Shed Skin','O Pokémon pode curar suas próprias condições de status, trocando de pele.');
INSERT INTO habilidade (nome,descricao) VALUES ('Sheer Force','Remove efeitos adicionais para aumentar o poder dos movimentos ao atacar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Shell Armor','Uma casca dura protege o Pokémon de Golpes Críticos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Shield Dust','O Pó que sai deste Pokémon bloqueia efeitos adicionais de golpes que o atingem.');
INSERT INTO habilidade (nome,descricao) VALUES ('Shields Down','Quando o HP do Pokémon atinge a metade ou menos, a concha do Pokémon se quebra e ele se torna mais agressivo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Simple','As mudanças de stats que o Pokémon recebe são duplicadas.');
INSERT INTO habilidade (nome,descricao) VALUES ('Skill Link','Maximiza o número de vezes que um movimento Multi-Strike atinge.');
INSERT INTO habilidade (nome,descricao) VALUES ('Slow Start','Por 5 turnos, os stats de Ataque e Velocidade do Pokémon são cortados pela metade.');
INSERT INTO habilidade (nome,descricao) VALUES ('Slush Rush','Aumenta o stat de Velocidade do Pokémon durante uma chuva de granizo');
INSERT INTO habilidade (nome,descricao) VALUES ('Sniper','Aumenta o poder de movimentos se eles se tornarem Golpes Críticos quando atacados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Snow Cloak','Aumenta a evasão do Pokémon em uma chuva de granizo');
INSERT INTO habilidade (nome,descricao) VALUES ('Snow Warning','O Pokémon invoca uma chuva de granizo ao entrar em batalha, causando danos de 1/16 do HP máximo em cada Pokémon em campo que não for do tipo Gelo, ao final de cada turno, por 5 turnos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Solar Power','Aumenta o Ataque Especial do Pokémon quando o sol estiver forte, mas diminui o HP a cada turno.');
INSERT INTO habilidade (nome,descricao) VALUES ('Solid Rock','Reduz o poder de movimentos superefetivos tomados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Soul-Heart','Aumenta o Ataque Especial do Pokémon toda vez que um Pokémon fica fora de combate.');
INSERT INTO habilidade (nome,descricao) VALUES ('Soundproof','Garante imunidade ao Pokémon a todos os movimentos baseados em Som.');
INSERT INTO habilidade (nome,descricao) VALUES ('Speed Boost','O stat de Velocidade do Pokémon é aumentado a cada turno.');
INSERT INTO habilidade (nome,descricao) VALUES ('Stakeout','Duplica o dano causado ao Pokémon que substituir o alvo se este retornar à pokébola.');
INSERT INTO habilidade (nome,descricao) VALUES ('Stall','O Pokémon se move por último.');
INSERT INTO habilidade (nome,descricao) VALUES ('Stalwart','Ignora os efeitos de redirecionamentos de ataques provenientes de habilidades');
INSERT INTO habilidade (nome,descricao) VALUES ('Stamina','Aumenta o stat de Defesa Física quando o Pokémon é atingido por um ataque.');
INSERT INTO habilidade (nome,descricao) VALUES ('Stance Change','O Pokémon muda para a Blade Forme quando usa um ataque e muda para a Shield Forme quando usa Kings Shield.');
INSERT INTO habilidade (nome,descricao) VALUES ('Static','Contato Físico com o Pokémon pode causar paralisia.');
INSERT INTO habilidade (nome,descricao) VALUES ('Steadfast','O stat de velocidade do Pokémon é ampliado toda vez que o Pokémon recua');
INSERT INTO habilidade (nome,descricao) VALUES ('Steam Engine','Aumenta drasticamente o status de Velocidade do Pokémon se for atingido por um movimento do tipo Fogo ou Água.');
INSERT INTO habilidade (nome,descricao) VALUES ('Steelworker','Aumenta o poder de movimentos do tipo Aço.');
INSERT INTO habilidade (nome,descricao) VALUES ('Steely Spirit','Aumenta o poder de movimentos do tipo Aço utilizados por aliados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Stench','Ao liberar um fedor ao atacar, esse Pokémon pode fazer com que o alvo recue');
INSERT INTO habilidade (nome,descricao) VALUES ('Sticky Hold','Os itens segurados pelo Pokémon ficam presos rapidamente e não podem ser removidos por outros Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Storm Drain','O Pokémon atrai para si todos os ataques dos tipo Água e ao invés de ser atingido por eles, o seu Ataque Especial é aumentado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Strong Jaw','A mandíbula forte do Pokémon aumenta o poder de seus movimentos baseados em Mordidas.');
INSERT INTO habilidade (nome,descricao) VALUES ('Sturdy','O Pokémon não pode ser derrotado com apenas 1 golpe, fazendo-o permanecer em batalha com apenas 1 ponto de HP.');
INSERT INTO habilidade (nome,descricao) VALUES ('Suction Cups','Este Pokémon usa ventosas para permanecer em um local para negar todos os movimentos e itens que forçam a troca.');
INSERT INTO habilidade (nome,descricao) VALUES ('Super Luck','O Pokémon tem tanta sorte que as taxas de seus movimentos se tornarem golpes críticos são aumentadas.');
INSERT INTO habilidade (nome,descricao) VALUES ('Supreme Overlord','Quando o Pokémon portador desta habilidade entra em batalha, seus Ataques Físico e Especial são levemente ampliados para cada um dos aliados na equipe do treinador que já tiverem sido derrotados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Surge Surfer','Dobra o stat de Velocidade do Pokémon no Terreno Elétrico.');
INSERT INTO habilidade (nome,descricao) VALUES ('Swarm','Amplifica o poder de movimentos do tipo Inseto quando o HP do Pokémon está baixo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Sweet Veil','Impede que o Portador e seus aliados sejam pego pela condição de status de Sono.');
INSERT INTO habilidade (nome,descricao) VALUES ('Swift Swim','Aumenta a Velocidade do Pokémon durante a chuva');
INSERT INTO habilidade (nome,descricao) VALUES ('Sword of Ruin','O poder da espada ruinosa do Pokémon reduz a base stat de Defesa');
INSERT INTO habilidade (nome,descricao) VALUES ('Symbiosis','O Pokémon passa seu item para um aliado que já usou o seu item.');
INSERT INTO habilidade (nome,descricao) VALUES ('Synchronize','O atacante receberá a mesma condição de status se infligir queimadura, veneno ou paralisia ao Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Tablets of Ruin','O poder das tábuas de madeira ruinosa do Pokémon reduz a base stat de Ataque');
INSERT INTO habilidade (nome,descricao) VALUES ('Tangled Feet','Aumenta o stat de Evasão se o Pokémon se encontrar confuso');
INSERT INTO habilidade (nome,descricao) VALUES ('Tangling Hair','Contato físico com o Pokémon diminui o stat de Velocidade do atacante.');
INSERT INTO habilidade (nome,descricao) VALUES ('Technician','Aumenta o poder dos movimentos mais fracos do Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Telepathy','Antecipa um movimento de aliado que possa vir a feri-lo e se esquiva dele.');
INSERT INTO habilidade (nome,descricao) VALUES ('Teravolt','Movimentos podem ser utilizados no alvo independentemente de suas habilidades.');
INSERT INTO habilidade (nome,descricao) VALUES ('Thermal Exchange','Quando o Pokémon portador desta habilidade é atingido por um movimento do tipo Fogo, seu stat de Ataque');
INSERT INTO habilidade (nome,descricao) VALUES ('Thick Fat','O Pokémon é protegido por uma camada de gordura espessa, que reduz pela metade o dano causado pelos movimentos do tipo Fogo e Gelo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Tinted Lens','O Pokémon pode usar movimentos "pouco eficazes" para causar dano regular.');
INSERT INTO habilidade (nome,descricao) VALUES ('Torrent','Aumenta o Poder de movimentos do tipo Água quando o HP do Pokémon estiver baixo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Tough Claws','Amplifica o poder de movimentos que causam contato físico.');
INSERT INTO habilidade (nome,descricao) VALUES ('Toxic Boost',' Potencializa ataques físicos quando o Pokémon está envenenado.');
INSERT INTO habilidade (nome,descricao) VALUES ('Toxic Debris','Espalha espinhos tóxicos aos pés do time opositor quando o Pokémon recebe dano de movimentos físicos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Trace','Quando entra em uma batalha, o Pokémon copia a habilidade de um Pokémon oponente.');
INSERT INTO habilidade (nome,descricao) VALUES ('Transistor','Aumenta o poder dos movimentos do tipo elétrico em 50%.');
INSERT INTO habilidade (nome,descricao) VALUES ('Triage','Dá prioridade a um movimento de cura.');
INSERT INTO habilidade (nome,descricao) VALUES ('Truant','O Pokémon não pode atacar se ele tiver usado um movimento no turno anterior.');
INSERT INTO habilidade (nome,descricao) VALUES ('Turboblaze','Movimentos podem ser utilizados no alvo independentemente de suas habilidades.');
INSERT INTO habilidade (nome,descricao) VALUES ('Unaware','Ao atacar, o Pokémon ignora as alterações de stats do alvo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Unburden','Aumenta o stat de Velocidade se o item que o Pokémon segura for usado ou perdido.');
INSERT INTO habilidade (nome,descricao) VALUES ('Unnerve',' Enerva Pokémon oponentes e os torna incapazes de comer Berries.');
INSERT INTO habilidade (nome,descricao) VALUES ('Unseen Fist','Se o Pokémon usa movimentos que fazem contato direto, ele pode acertar o alvo mesmo se o alvo se proteger.');
INSERT INTO habilidade (nome,descricao) VALUES ('Vessel of Ruin','O poder da embarcação ruinosa do Pokémon reduz a base stat de Ataque Especial de todos os Pokémon em campo, exceto ele mesmo.');
INSERT INTO habilidade (nome,descricao) VALUES ('Victory Star','Aumenta a precisão do Pokémon e de seus aliados.');
INSERT INTO habilidade (nome,descricao) VALUES ('Vital Spirit','O Pokémon é cheio de vitalidade, e isso evita que adormeça.');
INSERT INTO habilidade (nome,descricao) VALUES ('Volt Absorb','O Pokémon tem seu HP restaurado se atingido por um movimento do tipo Elétrico, ao invés de levar dano.');
INSERT INTO habilidade (nome,descricao) VALUES ('Wandering Spirit','O Pokémon troca de Habilidade com um Pokémon que o acertar com um movimento que faz contato direto.');
INSERT INTO habilidade (nome,descricao) VALUES ('Water Absorb','O Pokémon tem seu HP restaurado se atingido por um movimento do tipo Água, ao invés de levar dano.');
INSERT INTO habilidade (nome,descricao) VALUES ('Water Bubble','Reduz o poder dos movimentos do tipo Fogo causados no Pokémon e evita que o Pokémon se queime.');
INSERT INTO habilidade (nome,descricao) VALUES ('Water Compaction','Aumenta drasticamente o status de Defesa do Pokémon quando atingido por um movimento do tipo Água.');
INSERT INTO habilidade (nome,descricao) VALUES ('Water Veil','O Pokémon é coberto com um véu de água, o que impede que ele se queime.');
INSERT INTO habilidade (nome,descricao) VALUES ('Weak Armor','Ataques físicos que atingirem o Pokémon diminuem seu status de Defesa, mas aumentam drasticamente seu status de Velocidade.');
INSERT INTO habilidade (nome,descricao) VALUES ('Well-Baked Body','O Pokémon não sofre danos quando atingido por movimentos do tipo Fogo. Em vez disso, seu stat de Defesa');
INSERT INTO habilidade (nome,descricao) VALUES ('White Smoke','O  Pokémon é protegido por sua fumaça branca, o que impede que outros Pokémon reduzam seus stats.');
INSERT INTO habilidade (nome,descricao) VALUES ('Wimp Out','O Pokémon covardemente volta para a pokébola assim que seu HP atinge a metade ou menos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Wind Power','O Pokémon fica carregado quando é atingido por um movimento de "vento", aumentando o poder do próximo movimento do tipo Elétrico que o Pokémon portador desta habilidade utilizar. São considerados movimentos de vento');
INSERT INTO habilidade (nome,descricao) VALUES ('Wind Rider','Amplia o stat de Ataque');
INSERT INTO habilidade (nome,descricao) VALUES ('Wonder Guard','Seu poder misterioso permite que apenas movimentos superefetivos atinjam o Pokémon.');
INSERT INTO habilidade (nome,descricao) VALUES ('Wonder Skin','Faz com que movimentos de status tenham mais chances de falhar.');
INSERT INTO habilidade (nome,descricao) VALUES ('Zen Mode','Muda a forma do Pokémon assim que seu HP atinge a metade ou menos.');
INSERT INTO habilidade (nome,descricao) VALUES ('Zero to Hero','O Pokémon transforma-se em sua Forma Herói quando retorna para a pokébola.');
